import React, { Component } from 'react'
import axios from "axios";
import { Link } from 'react-router-dom';
import "bootstrap/dist/css/bootstrap.min.css";
const url2="http://localhost:4000/login/";
export default class Login extends Component {
  state={
    formdata:{
        emailId:"",
        password: "",
    },
    formError:{
        emailErr: "",
        passErr: "",
    },
    
    successMessage: "",
    errMessage: "",
    showPassword: false,
    
}
validateField = (name, value) => {
  if (name === "emailId") {
    let emailRegx =
      /^([a-z][a-zA-Z0-9_]*(\.[a-zA-Z][a-zA-Z0-9_]*)?@[a-z][a-zA-Z-0-9]*\.[a-z]+(\.[a-z]+)?)|[7-9][0-9]{9}$/;
    if (!value.match(emailRegx)) {
      this.setState({
          formError:{
            ...this.state.formError,
              emailErr:'Enter a valid Email, Eg:"abc@gmail.com"'
          }
      })
    } else {
      this.setState({
          formError:{
            ...this.state.formError,
              emailErr:''
          }
      })          }
  } else if (name === "password") {
    let passRegx = /^(?=.*\d)(?=.*[a-z])(?=.*[A-Z])(?=.*\W).{7,20}$/;
    if (!value.match(passRegx)) {
      this.setState({
          formError:{
            ...this.state.formError,
              passErr:"Password should contain atleast one speacial char,numbers,capital and small letter!"
          }
      })
    } else {
      this.setState({
          formError:{
            ...this.state.formError,
              passErr:""
          }
      })
    }
  }
};
handleChange = (e) => {
  const name = e.target.name;
  const value = e.target.value;
  this.setState({
      formdata: {
        ...this.state.formdata,
          [name]: value
      }
  })
  this.validateField(name, value);
};
     
    componentWillMount(){
    console.log("Component will mount")
    }
     
    validateField = (name, value) => {
      if (name === "emailId") {
        let emailRegx =
          /^([a-z][a-zA-Z0-9_]*(\.[a-zA-Z][a-zA-Z0-9_]*)?@[a-z][a-zA-Z-0-9]*\.[a-z]+(\.[a-z]+)?)|[7-9][0-9]{9}$/;
        if (!value.match(emailRegx)) {
          this.setState({
              formError:{
                ...this.state.formError,
                  emailErr:'Enter a valid Email, Eg:"abc@gmail.com"'
              }
          })
        } else {
          this.setState({
              formError:{
                ...this.state.formError,
                  emailErr:''
              }
          })          }
      } else if (name === "password") {
        let passRegx = /^(?=.*\d)(?=.*[a-z])(?=.*[A-Z])(?=.*\W).{7,20}$/;
        if (!value.match(passRegx)) {
          this.setState({
              formError:{
                ...this.state.formError,
                  passErr:"Password should contain atleast one speacial char,numbers,capital and small letter!"
              }
          })
        } else {
          this.setState({
              formError:{
                ...this.state.formError,
                  passErr:""
              }
          })
        }
      }
    };
     
    handleChange= (e)=> {
    this.setState({[e.target.name]:e.target.value});
    }
  render() {
    return (
      <form className="container">
      <div className="CreateBooking">
        <div className="row">
          <div className="col-md-6 offset-md-3">
            <br />
            <div className="card">
              <div className="card-header bg-custom">
                <h3>LOGIN</h3>
              </div>
              <div className="card-body">
                { 
                  <div class="form-group">
                  
                  
                  <label className="font-weight-bold">Username:</label>
                   <input type="text" className="form-control" 
                   value={this.state.uname}
                   name="uname" onChange={this.handleChange}
                   ></input>
                  

                  <label className="font-weight-bold">Password:</label>
                   <input type="password" className="form-control" 
                   value={this.state.password}
                   name="password" onChange={this.handleChange}
                   ></input>
                   
                   </div>  
                }
                <center><button type="button" className="btn btn-primary" onClick={this.getLogin}
                >Login</button></center>
               <Link to="/register" className="btn btn-link">Register</Link>
               <div align="center">
                    {
                       <p className="text-success">{this.state.successMessage}</p>
                    }
                    </div>
                  <div align="center">
                    {
                       <p className="text-danger">{this.state.errorMessage}</p>
                    }
                    
                  </div>
              </div>
            </div>
          </div>
        </div>
      </div>
      </form>
    )
  }
}
